module.exports = "<section>\r\n    <figure class=\"pt-5\">\r\n        <blockquote class=\"blockquote text-center\">\r\n            <p>Antecedentes</p>\r\n        </blockquote>\r\n        <div class=\"container\">\r\n            <p>\r\n                La Secretaria de Salud Federal, dise&#241;&#243; un programa espec&#237;fico de prevenci&#243;n y atenci&#243;n a la violencia familiar, sexual y contra las mujeres, en respuesta a los resultados de la Encuesta Nacional sobre violencia contra las Mujeres\r\n                (ENVIM 2003). La Coordinaci&#243;n del Programa Mujer y Salud, posteriormente el Centro Nacional de Equidad de Genero y Salud Reproductiva dise&#241;&#243; un modelo de prevenci&#243;n y atenci&#243;n de la violencia hacia las mujeres\r\n                en los espacios de salud. Entre los a&#241;os 2000 y 2008, se valida el modelo por la H. C&#225;mara de Diputados y se extiende paulatinamente a los servicios de salud de las Entidades Federativas. <br> En el a&#241;o 2003,\r\n                el Centro Nacional de Equidad de G&#233;nero y Salud Reproductiva propone al Estado de Hidalgo integrar un proyecto de intervenci&#243;n hacia la violencia familiar, sexual y contra las mujeres, con la participaci&#243;n de cuatro instituciones\r\n                p&#250;blicas del Gobierno del Estado: Servicios de Salud de Hidalgo (SSH), Instituto Hidalguense de las Mujeres, La Procuradur&#237;a de la Defensa del Menor y la Familia del Sistema DIF Hidalgo y la Direcci&#243;n de Atenci&#243;n a\r\n                V&#237;ctimas de la Procuradur&#237;a de Justicia del Estado para operar una &quot;Unidad Especializada para la Prevenci&#243;n y Atenci&#243;n de todas las formas de Violencia hacia las Mujeres&quot; (UEPAVM). <br> Unidad que surgi&#243;\r\n                en el a&#241;o 2003 dentro del proyecto interinstitucional denominado &quot;Piloteo del Modelo Hidalguense Integrado de Prevenci&#243;n y Atenci&#243;n de la Violencia Familiar, Sexual y contra las Mujeres&quot;, el cual se dise&#241;&#243;\r\n                para dar respuesta a la ya incipiente demanda de las mujeres para atender su situaci&#243;n de violencia familiar principalmente con la pareja. <br> El proyecto busca proporcionar una atenci&#243;n integral y m&#233;dica a las mujeres\r\n                y hombres, as&#237; como a la familia de estos, para contener el estado de crisis emocional y proporcionar asesor&#237;a jur&#237;dica, es as&#237; como el 3 de diciembre del 2003, se pone en marcha la Unidad Especializada para la Prevenci&#243;n\r\n                y Atenci&#243;n de todas las formas de Violencia hacia las Mujeres&quot; (UEPAVM), la cual en el 2005 deja de ser un modelo piloto sustentado por el nivel Nacional y se convierte en una Unidad Especializada para la Atenci&#243;n de la\r\n                Violencia Familiar y Sexual, es as&#237; como en el a&#241;o 2006 cambia de denominaci&#243;n ya que no solo estaba atendiendo mujeres sino tambi&#233;n a hombres. <br> Desde su puesta en marcha, se program&#243; para que diera atenci&#243;n\r\n                psicol&#243;gica a mujeres mayores de 15 a&#241;os como lo indicaba el modelo nacional, sin embargo, desde su inicio se propuso proporcionar asesor&#237;a jur&#237;dica, meses despu&#233;s se incluy&#243; el servicio de psicolog&#237;a\r\n                infantil para ni&#241;os y ni&#241;as entre 5 y 12 a&#241;os de edad y mujeres adolescentes de 13 a 18 a&#241;os, y poco a poco se fueron integrando a su manejo terap&#233;utico hombres en las diferentes etapas de la vida: adolescentes,\r\n                juvenil y adultez. <br> En el 2010 la Unidad Especializada para la Prevenci&#243;n y Atenci&#243;n a la Violencia Familiar y Sexual, formaliza su creaci&#243;n mediante Acuerdo Aprobado por la junta del Consejo Directivo de Servicios de\r\n                Salud de Hidalgo, en la 31&#170;. Reuni&#243;n Ordinaria celebrada el 25 de febrero del a&#241;o 2010, y el 18 de junio del 2012 se recibe la aceptaci&#243;n por parte de la Comisi&#243;n Interna de Seguimiento y Cumplimiento de las Medidas\r\n                de Racionalidad, Disciplina y Eficiencia del Gasto Publico (CISCMRDE) del Gobierno del Estado.\r\n            </p>\r\n        </div>\r\n    </figure>\r\n</section>"

